Dans le cadre de la campagne de vaccination contre la Covid-19 et du calendrier vaccinal préconisé par la Haute Autorité de Santé (HAS), le centre de vaccination accueille pour se faire vacciner :
•             Les personnes de plus de 75 ans ;
•             Les professionnels de santé de plus de 50 ans, y compris les professionnels libéraux;
•             Les personnels des établissements de santé et médico-sociaux de plus de 50 ans intervenant auprès des personnes vulnérables ;
•             Les aides à domicile de plus de 50 ans intervenant auprès des personnes vulnérables ;
•             Les pompiers de plus de 50 ans.

